&lt;H1 align=center&gt;&lt;font size=&quot;1&quot;&gt; &lt;b&gt;Game Info:&lt;/b&gt;
In TimeSplitters Future Perfect, victory is in the hands
of the player's past, present, and future self in a 
battle that stretches throughout time where humanity is 
on the brink of destruction from the malevolent
TimeSplitters. Cortez-the tough-as-nails hero from 
previous installments-finds himself in a frantic race 
against time in a desperate bid to trace the origin of 
the TimeSplitters and save mankind. This third
installment of the best-selling franchise will feature 
hundreds of hours of gameplay and an improved Story mode
that ties all the missions together, immersing gamers in 
an epic adventure between the years of 1914 and 2401. &lt;/font&gt;&lt;/h1&gt;
